import React from 'react';
import './BenefitDescriptionBlock.less';
// import { OptionsType } from '../AccommodationTypes/OptionsType';
// import { RulesType } from '../AccommodationTypes/RulesType';

type BenefitDescriptionBlockType = {
  // options: OptionsType
  // rules: RulesType
  description: string
};

const BenefitDescriptionBlock: React.FC<BenefitDescriptionBlockType> = ({ description }: BenefitDescriptionBlockType) => (
  <>
    <div className="options-block">
      <div className="block-title">Удобства и условия проживания</div>
    </div>
    <div className="description-block">
      <div className="block-title">Описание</div>
      {description}
    </div>
  </>
);

export default BenefitDescriptionBlock;
